import React from 'react'
import FooterImg from '../assets/footer.webp'
import styled from 'styled-components'

const Container = styled.footer`
    margin-top: -25em;
    padding-bottom: 40px;
    padding-top: 40em;
    position: relative;
    width: 100%;

    &:before{
        background: url(${FooterImg}) no-repeat scroll bottom transparent;
        background-size: 180% 80em;
        bottom: 0;
        content: "";
        height: 100%;
        left: 0;
        position: absolute;
        width: 100%;
        z-index: -2;    
    }
`;


const Container4 = styled.div`
    padding-right: 3em;
`

const Title = styled.h2`
    color: #fff;
    font-family: Ruberoid;
    font-weight: 700;
    letter-spacing: 0;
    margin-bottom: 20px;
    font-size: 40px;
    line-height: 48px;
`

function Footer() {
  return (
    <Container>
        {/* <SubContainer> */}
                <Container4>
                    <Title>Subscribe to our newsletter</Title>
                </Container4>
        {/* </SubContainer> */}
        <h2>Hello</h2>
    </Container>
  );
}

export default Footer;
